Mongoose query 8x slower than shell<p>I have a collection with 200,000+ documents in that I'm filtering with a few where clauses.</p>

<p>Here's my query in Mongoose: </p>

<pre><code> const assets = await GpsLog
                          .where('gps_time')
                          .gte(first)
                          .lte(last)
                          .where('location')
                          .within()
                          .geometry(geoFence);
</code></pre>

<p>Where <code>geofence</code> is a GeoJSON polygon.</p>

<p>The shell query I'm running is:</p>

<pre><code>db.gps_log.find({
  'gps_time': {
    $gte: first,
    $lte: last
  },
  'location': {
    '$geoIntersects': {
      '$geometry': {
        'type': 'Polygon',
        'coordinates': // polygon
      }
    }
  }
})
</code></pre>

<p>The Mongoose query completes in anywhere between 5 to 11 seconds, whereas the shell query completes in 0.5s.</p>

<p>I translated the shell query to execute in Mongoose as:</p>

<pre><code>const res = await GpsLog.find({
  'gps_time': {
    $gte: 1539648000,
    $lte: 1539820800
  },
  'location': {
    '$geoIntersects': {
      '$geometry': geoFence
    }
  }
}).lean().exec();
</code></pre>

<p>But it's still taking 4+ seconds to execute.</p>

<p>Am I missing something with the speed difference?</p>

