import AppBar from './components/AppBar';
import Popover from './components/Popover';
import { connect } from 'react-redux';

class ToDo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      list: [],
      title: '',
      todo: '',
    };
  };

  componentDidMount = () =&gt; {
    fetch("/api/todos")
      .then(data =&gt; data.json())
      .then(res =&gt; this.setState({ list: res.data }));
    console.log(this.state.list)
  };


  createNewToDoItem = () =&gt; {
    fetch("/api/todos", {
      method: "post",
      headers: new Headers({
        "Content-Type": "application/json"
      }),
      body: JSON.stringify({
        title: this.state.title,
        body: this.state.todo
      })
    })
      .catch(err =&gt; {
        console.error(err);
      });

    if (this.state.title !== '' &amp; this.state.todo !== '') {
      this.props.createTodoItem(this.state.title, this.state.todo);
      this.setState({ title: '', todo: '' });
    }
  };

  handleTitleInput = e =&gt; {
    this.setState({
      title: e.target.value,
    });
  };

  handleTodoInput = e =&gt; {
    this.setState({
      todo: e.target.value,
    });
  };

  editItem = (i, updTitle, updToDo) =&gt; {
    const modifyURL = "/api/todos/" + i;
    fetch(modifyURL, {
      method: "put",
      headers: new Headers({
        "Content-Type": "application/json"
      }),
      body: JSON.stringify({
        title: updTitle,
        todo: updToDo
      })
    })
      .then(resp =&gt; {
        if (!resp.ok) {
          if (resp.status &gt;= 400 &amp;&amp; resp.status &lt; 500) {
            return resp.json().then(data =&gt; {
              let error = { errorMessage: data.message };
              throw error;
            });
          } else {
            let error = {
              errorMessage: "Please try again later. Server is not online"
            };
            throw error;
          }
        }
        return resp.json();
      })
      .then(newTodo =&gt; {
        let arr = this.props.list;
        arr[i].title = updTitle;
        arr[i].todo = updToDo;
        this.setState({ updateList: true });
      });
  };

  deleteItem = indexToDelete =&gt; {
    const deleteURL = "/api/todos/" + indexToDelete;
    fetch(deleteURL, {
      method: "delete"
    })
      .then(resp =&gt; {
        if (!resp.ok) {
          if (resp.status &gt;= 400 &amp;&amp; resp.status &lt; 500) {
            return resp.json().then(data =&gt; {
              let error = { errorMessage: data.message };
              throw error;
            });
          } else {
            let error = {
              errorMessage: "Please try again later. Server is not online"
            };
            throw error;
          }
        }
        return resp.json();
      })
      .then(() =&gt; {
        this.props.deleteTodoItem(indexToDelete);
      });
  };

  randId() {
    return Math.random().toString(36).replace(/[^a-z]+/g, '').substr(2, 10);
  }

  eachToDo = (item, i) =&gt; {
    return &lt;ToDoItem
      key={this.randId()}
      title={item.title}
      todo={item.todo}
      deleteItem={this.deleteItem.bind(this, i)}
      editItem={this.editItem.bind(this, i)}
    /&gt;
  };

  render() {
    const { list } = this.props;
    return (
      &lt;div className="ToDo"&gt;
        &lt;img className="Logo" src={Logo} alt="React logo" /&gt;
        &lt;AppBar /&gt;
        &lt;div className="ToDo-Container"&gt;

          &lt;div className="ToDo-Content"&gt;
            {list.map(this.eachToDo)}
          &lt;/div&gt;

          &lt;div&gt;
            &lt;Popover
              toDoValue={this.state.todo}
              titleValue={this.state.title}
              titleOnChange={this.handleTitleInput}
              toDoOnChange={this.handleTodoInput}
              addHandler={this.createNewToDoItem}
            /&gt;
          &lt;/div&gt;
        &lt;/div&gt;
      &lt;/div&gt;
    );
  }
}

const mapStateToProps = (state) =&gt; {
  return {
    list: state.list
  }
}

const mapDispatchToProps = dispatch =&gt; {
  return {
    deleteTodoItem: id =&gt; {
      dispatch({ type: "DELETE_TODO", id: id });
    },
    createTodoItem: (title, todo) =&gt; {
      dispatch({ type: "CREATE_TODO", title: title, todo: todo });
    }
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(ToDo);
